import React, { Component } from 'react'

export default class WordRecommend extends Component {
  render() {
    return (
      <div>
        <h2>By Keyword</h2>
        <ul>
            <li>Lipstick</li>
            <li>Foundation</li>
            <li>Blush</li>
            <li>EyeShadow</li>
            <li>Blonzer</li>
            <li>EyeBrow</li>
            <li>Eyeliner</li>
            <li>Marcara</li>
        </ul>

      </div>
    )
  }
}
